def solution(A, B, K):
	edge = 0
	if A == 0 and B == 0:
		return 1
	if A == B:
		if A%K == 0:
			return 1
		return 0
	if K == 1:
		return B - A + 1
	if A%K == 0:
		edge += 1
	if K >= A:
		return B//K + edge
	else:
		return B//K - A//K + edge

