def arrayF(n):
	F = [0] * (n + 1)
	i = 2
	while (i * i <= n):
		if (F[i] == 0):
			k = i * i
			while (k <= n):
				if (F[k] == 0):
					F[k] = i;
				k += i
		i += 1
	return F

