def gcd(a, b):
	if a % b == 0:
		return b
	return gcd(b, a % b)


def solution(N, M):
	greatest_common_divisor = gcd(N, M)
	least_common_multiple = N*M/greatest_common_divisor
	return least_common_multiple/M

def decay(n):
	primes = []
	for i in range(2, n+1):
		while n % i == 0:
			primes.append(i)
			n = n/i
			if n == 1:
				break
	return set(primes)


