	return results

import operator as op

def ncr(n, r):
	r = min(r, n-r)
	if r == 0: return 1
	try:
		numer = reduce(op.mul, xrange(n, n-r, -1))
		denom = reduce(op.mul, xrange(1, r+1))
	except TypeError:
		return 0
	return numer//denom

def solution(A, B):
	L = len(A)
	result = []
	
	for index in xrange(L):
		count = A[index]
		partial_sum = 0
		for i in xrange(L):
			partial_sum += ncr(count, i)
			if i > count:
				break
			count -= 1
		result.append(partial_sum % 2**B[index])
	return result

def fib(n):
	result = []
	a, b = 0, 1
	while a <= n:
		result.append(a)
		a, b = b, a+b
	return result

